document.getElementById("mechine_ipad").addEventListener("click", function() {
  document.querySelector(".content").innerHTML = `
                               <h1>付款人数预测图</h1>
                               <div id="ipad_mechine_plot" class="show" style="width: 100%;height: 100%"></div>
                             `;
(function() {
  $.ajax({
    url:'/meching_ipad',
    async:false,
    success:function(data){
      mydata=data.data

    }
  })
  // 基于准备好的dom，初始化echarts实例
  var myChart = echarts.init(document.getElementById('ipad_mechine_plot'));
  // (1)准备数据
  // 2. 指定配置和数据
  var option = {
  title: {
    text: '采用随机森林算法预测',
      subtext:'横坐标为真实价格，纵坐标为预测价格'
  },
  grid: {
    left: '3%',
    right: '7%',
    bottom: '7%',
    containLabel: true
  },
  tooltip: {
    // trigger: 'axis',
    showDelay: 0,
    formatter: function (params) {
      if (params.value.length > 1) {
        return (
          params.seriesName +
          ' :<br/>' +
          params.value[0] +
          '元 ' +
          params.value[1] +
          '元 '
        );
      } else {
        return (
          params.seriesName +
          ' :<br/>' +
          params.name +
          ' : ' +
          params.value +
          '元 '
        );
      }
    },
    axisPointer: {
      show: true,
      type: 'cross',
      lineStyle: {
        type: 'dashed',
        width: 1
      }
    }
  },
  toolbox: {
    feature: {
      dataZoom: {},
      brush: {
        type: ['rect', 'polygon', 'clear']
      }
    }
  },
  brush: {},

  xAxis: [
    {
      type: 'value',
      scale: true,
      axisLabel: {
        formatter: '{value} 元'
      },
      splitLine: {
        show: false
      }
    }
  ],
  yAxis: [
    {
      type: 'value',
      scale: true,
      axisLabel: {
        formatter: '{value} 元'
      },
      splitLine: {
        show: false
      }
    }
  ],
  series: [
    {
      name: '价格',
      type: 'scatter',
      emphasis: {
        focus: 'series'
      },
      // prettier-ignore
      data: mydata,
      markArea: {
        silent: true,
        itemStyle: {
          color: 'transparent',
          borderWidth: 1,
          borderType: 'dashed'
        },
        data: [
          [
            {
              name: '价格预测区间',
              xAxis: 'min',
              yAxis: 'min'
            },
            {
              xAxis: 'max',
              yAxis: 'max'
            }
          ]
        ]
      },
      markPoint: {
        data: [
          { type: 'max', name: 'Max' },
          { type: 'min', name: 'Min' }
        ]
      },
      markLine: {
        lineStyle: {
          type: 'solid'
        },
        data: [{ type: 'average', name: 'AVG' }, { xAxis: 160 }]
      }
    },
    {
      name: 'Male',
      type: 'scatter',
      emphasis: {
        focus: 'series'
      },
      // prettier-ignore




    }
  ]
};;
  // 3. 把配置和数据给实例对象
  myChart.setOption(option);

  // 重新把配置好的新数据给实例对象
  myChart.setOption(option);
  window.addEventListener("resize", function() {
    myChart.resize();
  });
})();
});


